?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">История этой известнейшей часовой марки начинается с 1892 года. Компания была основана в Пенсильвании, в городе Ланкастер. Первая модель под названием Broadway Limited, выпущенная компанией Hamilton, успешно проявила себя в железнодорожной сфере Америки. И это легко объясняется: благодаря надежности и точности часов, в железнодорожной сфере больше не случалось несчастных случаев или аварий. С 1920 года, сменяет свою производственную ориентацию и запускает производство часов для американской армии. Стоит отметить, что многие американские военные пользовались часами Hamilton во время боевых действий в Первой Мировой войне. А когда началась Вторая Мировая, компания начала выпускать часы только для военных, ведь на время войны гражданские часы не производили. На данный момент, компания Gamilton принадлежит Swatch Group. Интересно, что компании принадлежат новейшие, на середину 20-го века, разработки. Например, Gamilton выпустила первые в мире электронные (1970 год) и кварцевые часы (1957 год).&nbsp;</span></span></p>
 
